const Navbar = ()=>{
    return (
        <>
            <div className='container-fluid bg-dark text-white'>
                <div className='d-flex justify-content-between'>
                <div className='d-flex justify-content-evenly p-1'>
                    <h4 className='p-1' onClick={()=>{alert('hello man')}}>Home</h4>
                    <h4 className='p-1'>Link 1</h4>
                </div>
                <div className='d-flex justify-content-start p-1'>
                    <h4>About Us</h4>
                    <h4>User</h4>
                </div>
                </div>
            </div>
        </>
    );
}

export default Navbar;
